package cn.mxz.messagesender;import com.lemon.commons.socket.ISocket;import cn.javaplus.comunication.PacketCompressedByZlib;public class UserMessageSenderImpl implements UserMessageSender{	/**	 *	 */	public void onUpdateUserList(ISocket socket, cn.mxz.protocols.user.UserP.UserPro user) {		PacketCompressedByZlib p = new PacketCompressedByZlib();		p.putInt(430003);				p.putString("");		p.put(user);		p.send(socket);	}}